-- ----------------------------
-- Table structure for `t_category`
-- ----------------------------
DROP TABLE IF EXISTS `t_category`;
CREATE TABLE `t_category` (
  `id` bigint(11) NOT NULL COMMENT '主键',
  `name` varchar(50) DEFAULT NULL COMMENT '分类名称',
  `type` varchar(11) DEFAULT NULL,
  `parent_id` bigint(11) DEFAULT NULL COMMENT '父分类ID',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '1' COMMENT '状态',
  `create_id` bigint(18) DEFAULT NULL COMMENT '创建者id',
  `update_id` bigint(18) DEFAULT NULL COMMENT '修改者id',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `icon` varchar(1000) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '图标',
  `path` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of t_category
