-- ----------------------------
-- Table structure for `t_order`
-- ----------------------------
DROP TABLE IF EXISTS `t_order`;
CREATE TABLE `t_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '标题',
  `order_id` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '订单ID',
  `bailor` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '委托人',
  `schedule` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '进度',
  `sum_money` decimal(10,2) DEFAULT NULL COMMENT '订单总金额',
  `require_date` date DEFAULT NULL COMMENT '要求完成时间',
  `complete_date` date DEFAULT NULL COMMENT '实际完成时间',
  `type` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '订单类型',
  `state` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '订单状态',
  `image` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '相关图片',
  `files` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '相关文件',
  `cus_name` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '客户名称',
  `cus_company` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '客户单位',
  `cus_address` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '客户地址',
  `cus_phone` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '客户电话',
  `cus_desc` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '客户描述信息',
  `express_info` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '快递信息',
  `express_date` date DEFAULT NULL COMMENT '快递时间',
  `remark` varchar(2000) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `del_flag` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '删除标记Y：正常；N：删除；A：审核',
  `create_id` bigint(20) DEFAULT NULL COMMENT '创建者id',
  `update_id` bigint(20) DEFAULT NULL COMMENT '修改者id',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1115609107276910594 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of t_order
