-- ----------------------------
-- Table structure for `t_order_detail`
-- ----------------------------
DROP TABLE IF EXISTS `t_order_detail`;
CREATE TABLE `t_order_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单号',
  `pro_id` bigint(20) DEFAULT NULL COMMENT '产品id',
  `pro_info` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '产品信息',
  `price` decimal(10,2) DEFAULT NULL COMMENT '订单价格',
  `require_count` int(11) DEFAULT NULL COMMENT '订单数量',
  `produce_count` int(11) DEFAULT NULL COMMENT '生产数量',
  `deal_count` int(11) DEFAULT NULL COMMENT '交易数量',
  `money` decimal(10,2) DEFAULT NULL COMMENT '总金额',
  `schedule` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '目前进度',
  `state` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '状态',
  `dept` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '负责部门',
  `owner` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '负责人',
  `type` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '类型',
  `complete_date` datetime DEFAULT NULL COMMENT '完成时间',
  `image` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '图片',
  `files` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '文件',
  `remark` varchar(2000) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `del_flag` varchar(20) CHARACTER SET utf8 DEFAULT '1' COMMENT '状态，0正常，1删除',
  `create_id` bigint(18) DEFAULT NULL COMMENT '创建者id',
  `update_id` bigint(18) DEFAULT NULL COMMENT '修改者id',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

