  `id` bigint(18) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_id` bigint(18) DEFAULT NULL COMMENT '创建者id',
  `update_id` bigint(18) DEFAULT NULL COMMENT '修改者id',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(1000) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` varchar(1) DEFAULT NULL COMMENT '删除标记Y：正常；N：删除；A：审核',
  `pro_no` varchar(50) DEFAULT NULL COMMENT '产品标号',
  `pro_name` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `pro_util` varchar(50) DEFAULT NULL COMMENT '产品单位',
  `description` varchar(1000) DEFAULT NULL COMMENT '产品描述',
  `specifications` varchar(50) DEFAULT NULL COMMENT '规格',
  `material` varchar(50) DEFAULT NULL COMMENT '材料',
  `models` varchar(50) DEFAULT NULL COMMENT '型号',
  `image_no` varchar(50) DEFAULT NULL COMMENT '图号',
  `image_url` varchar(200) DEFAULT NULL COMMENT '图片',
  `file_url` varchar(200) DEFAULT NULL COMMENT '附件',
  `in_price` decimal(10,2) DEFAULT NULL COMMENT '成本价',
  `out_price` decimal(10,2) DEFAULT NULL COMMENT '售价',
